s: session.images\n\t\t\t.filter(img => img.status === 'completed')\n\t\t\t.map(img => ({\n\t\t\t\timageId: img.id,\n\t\t\t\tfilename: img.filename,\n\t\t\t\tstatus: img.status,\n\t\t\t\twidth: img.naturalWidth,\n\t\t\t\theight: img.naturalHeight,\n\t\t\t\tdetections: img.detections,\n\t\t\t\tglobal_insights: img.parsedData?.global_insights || []\n\t\t\t}))\n\t};\n\n\treturn JSON.stringify(exportData, null, 2);\n}\n\n/**\n * Export session data as CSV\n * @param {object} session - Session state with aggregates\n * @returns {string} CSV string\n */\nexport function exportSessionCSV(session) {\n\tconst rows = [];\n\t\n\t// Header row\n\trows.push([\n\t\t'SessionID',\n\t\t'ImageID',\n\t\t'ImageName',\n\t\t'DetectionID',\n\t\t'Label',\n\t\t'Category',\n\t\t'Confidence',\n\t\t'SafetySeverity',\n\t\t'SafetyRule',\n\t\t'ProgressPhase',\n\t\t'ProgressPercent'\n\t].join(','));\n\n\t// Data rows\n\tsession.images.forEach(img => {\n\t\tif (img.status === 'completed' && img.detections) {\n\t\t\timg.detections.forEach(det => {\n\t\t\t\tconst row = [\n\t\t\t\t\tescapeCsvField(session.sessionId),\n\t\t\t\t\tescapeCsvField(img.id),\n\t\t\t\t\tescapeCsvField(img.filename),\n\t\t\t\t\tescapeCsvField(det.id || ''),\n\t\t\t\t\tescapeCsvField(det.label || ''),\n\t\t\t\t\tescapeCsvField(det.category || ''),\n\t\t\t\t\tdet.confidence != null ? det.confidence.toFixed(4) : '',\n\t\t\t\t\tdet.safety?.severity ? escapeCsvField(det.safety.severity) : '',\n\t\t\t\t\tdet.safety?.rule ? escapeCsvField(det.safety.rule) : '',\n\t\t\t\t\tdet.progress?.phase ? escapeCsvField(det.progress.phase) : '',\n\t\t\t\t\tdet.progress?.percentComplete != null ? det.progress.percentComplete.toFixed(2) : ''\n\t\t\t\t];\n\t\t\t\trows.push(row.join(','));\n\t\t\t});\n\t\t}\n\t});\n\n\treturn rows.join('\\n');\n}\n\n/**\n * Download exported data as a file\n * @param {string} content - File content\n * @param {string} filename - Suggested filename\n * @param {string} mimeType - MIME type\n */\nexport function downloadFile(content, filename, mimeType) {\n\tconst blob = new Blob([content], { type: mimeType });\n\tconst url = URL.createObjectURL(blob);\n\tconst link = document.createElement('a');\n\tlink.href = url;\n\tlink.download = filename;\n\tdocument.body.appendChild(link);\n\tlink.click();\n\tdocument.body.removeChild(link);\n\tURL.revokeObjectURL(url);\n}\n\n/**\n * Escape CSV field value\n * @param {string} value - Field value\n * @returns {string} Escaped value\n */\nfunction escapeCsvField(value) {\n\tif (value == null) return '';\n\tconst str = String(value);\n\tif (str.includes(',') || str.includes('\"') || str.includes('\\n')) {\n\t\treturn `\"${str.replace(/\"/g, '\"\"')}\"`;\n\t}\n\treturn str;\n}\n\n/**\n * Get progress counts helper\n * @param {object} session - Session state\n * @returns {object} Progress counts\n */\nfunction getProgressCounts(session) {\n\tconst completed = session.images.filter(img => img.status === 'completed').length;\n\tconst error = session.images.filter(img => img.status === 'error').length;\n\treturn { completed, error };\n}\n"},"src/geometry.js":{"language":"javascript","mutants":[{"id":"369","mutatorName":"StringLiteral","replacement":"\"\"","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":21,"line":49},"start":{"column":11,"line":49}}},{"id":"382","mutatorName":"StringLiteral","replacement":"\"\"","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":70,"line":62},"start":{"column":51,"line":62}}},{"id":"395","mutatorName":"StringLiteral","replacement":"\"\"","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":61,"line":67},"start":{"column":51,"line":67}}},{"id":"348","mutatorName":"ConditionalExpression","replacement":"true","statusReason":"Error: expect(received).toEqual(expected) // deep equality\n\nExpected: {\"height\": 40, \"width\": 80, \"x\": 20, \"y\": 20}\nReceived: null\n    at Object.toEqual (/home/runner/work/gemini-vlm-demo/gemini-vlm overage","static":false,"coveredBy":[],"location":{"end":{"column":28,"line":682},"start":{"column":14,"line":682}}},{"id":"1046","mutatorName":"BlockStatement","replacement":"{}","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":4,"line":684},"start":{"column":30,"line":682}}},{"id":"1047","mutatorName":"ArrowFunction","replacement":"() => undefined","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":73,"line":683},"start":{"column":58,"line":683}}},{"id":"1048","mutatorName":"ObjectLiteral","replacement":"{}","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":95,"line":689},"start":{"column":9,"line":689}}},{"id":"1049","mutatorName":"StringLiteral","replacement":"\"\"","status":"NoCoverage","static":false,"coveredBy":[],"location":{"end":{"column":93,"line":689},"start":{"column":20,"line":689}}}],"source":"/* istanbul ignore file */\n\nimport { AEC_PROMPT, RESPONSE_SCHEMA } from './aec-schema.js';\nimport {\n\ttoCanvasBox,\n\ttoCanvasPolygon,\n\tensureCoordSystem,\n\tensureCoordOrigin\n} from './geometry.js';\nimport {\n\tcolorForCategory,\n\textractJSONFromResponse,\n\tcalculateDisplayScale,\n\tformatJsonOutput,\n\textractBase64FromDataUrl,\n\tprepareDetectionData\n} from './ui-utils.js';\nimport {\n\trenderReportUI,\n\tsetupReportInteractions\n} from './report-ui.js';\nimport {\n\tcreateSession,\n\tcalculateSessionAggregates,\n\tupdateSessionStatus,\n\tgetSessionProgress\n} from './session.js';\nimport { processBatch } from './batch-processor.js';\nimport { exportSessionJSON, exportSessionCSV, downloadFile } from './export.js';\n\n// ---------- UI Elements ----------\nconst apiKeyEl = document.getElementById('apiKey');\nconst modelEl  = document.getElementById('model');\nconst fileEl   = document.getElementById('file');\nconst dropzone = document.getElementById('dropzone');\nconst canvas   = document.getElementById('canvas');\nconst ctx      = canvas.getContext('2d');\nconst reportWrap = document.getElementById('reportWrap');\nconst jsonOut  = document.getElementById('jsonOut');\nconst progressBar = document.getElementById('progressBar');\nconst progressText = document.getElementById('progressText');\nconst progressFill = document.getElementById('progressFill');\nconst gallery = document.getElementById('gallery');\n\nconst STORAGE_KEY = 'geminiApiKey';\nconst MAX_IMAGES = 20;\n\n// Session state\nlet currentSession = null;\nlet isAnalyzing = false;\nlet pendingApiKeyAnalysis = false;\n\n// Legacy single-image state (for backwards compatibility)\nlet currentFile = null;\nlet currentImageBitmap = null;\nlet currentDetections = [];\nlet currentParsedData = null;\nlet naturalW = 0, naturalH = 0;\nlet highlightedDetectionId = null;\nlet analysisQueued = false;\n\n// ---------- Helpers ----------\nfunction logJson(obj, note) {\n\tjsonOut.textContent = formatJsonOutput(obj, note);\n}\n\nfunction clearReport() {\n\treportWrap.innerHTML = '';\n}\n\n// ---------- Multi-Image Functions ----------\n\nasync function handleMultipleFiles(files) {\n\tconst fileArray = Array.from(files);\n\t\n\tif (fileArray.length > MAX_IMAGES) {\n\t\tlogJson({ error: `Maximum ${MAX_IMAGES} images allowed. You selected ${fileArray.length}.` }, 'Error');\n\t\treturn;\n\t}\n\n\tconst apiKey = apiKeyEl.value.trim();\n\tif (!apiKey) {\n\t\tpendingApiKeyAnalysis = true;\n\t\tlogJson({ message: `${fileArray.length} images loaded. Enter your API key to start analysis.` });\n\t\treturn;\n\t}\n\n\tpendingApiKeyAnalysis = false;\n\tawait analyzeMultipleImages(fileArray);\n}\n\nasync function analyzeMultipleImages(files) {\n\tif (isAnalyzing) return;\n\tisAnalyzing = true;\n\n\t// Create session\n\tcurrentSession = createSession(files);\n\t\n\t// Hide dropzone, show progress bar and gallery\n\tdropzone.style.display = 'none';\n\tprogressBar.style.display = 'block';\n\tgallery.style.display = 'block';\n\tclearReport();\n\n\t// Render gallery\n\trenderGallery();\n\n\t// Load image bitmaps\n\tfor (const img of currentSession.images) {\n\t\ttry {\n\t\t\timg.bitmap = await createImageBitmap(img.file);\n\t\t\timg.naturalWidth = img.bitmap.width;\n\t\t\timg.naturalHeight = img.bitmap.height;\n\t\t} catch (err) {\n\t\t\timg.error = `Failed to load image: ${err.message}`;\n\t\t\timg.status = 'error';\n\t\t}\n\t\tupdateGalleryThumb(img.id);\n\t}\n\n\t// Display first image\n\tif (currentSession.images.length > 0) {\n\t\tawait displaySessionImage(0);\n\t}\n\n\t// Process all images\n\tconst apiKey = apiKeyEl.value.trim();\n\tconst model = modelEl.value.trim() || 'gemini-2.5-pro';\n\n\tawait processBatch(\n\t\tcurrentSession.images.filter(img => img.status === 'queued'),\n\t\tasync (img) => {\n\t\t\timg.status = 'analyzing';\n\t\t\tupdateProgress();\n\t\t\tupdateGalleryThumb(img.id);\n\n\t\t\tconst resp = await callGeminiREST({ apiKey, model, file: img.file });\n\t\t\tconst parsed = extractJSONFromResponse(resp);\n\t\t\tprepareDetectionData(parsed, img.naturalWidth, img.naturalHeight);\n\n\t\t\tconst coordSystem = ensureCoordSystem(parsed, 'normalized_0_1000');\n\t\t\tensureCoordOrigin(parsed, 'top-left');\n\t\t\tif (parsed.image.coordSystem == null) parsed.image.coordSystem = coordSystem;\n\n\t\t\timg.parsedData = parsed;\n\t\t\timg.detections = Array.isArray(parsed.detections) ? parsed.detections : [];\n\t\t\timg.status = 'completed';\n\n\t\t\treturn parsed;\n\t\t},\n\t\t(img, result, error) => {\n\t\t\tif (error) {\n\t\t\t\timg.error = String(error?.message || error);\n\t\t\t\timg.status = 'error';\n\t\t\t}\n\t\t\tupdateProgress();\n\t\t\tupdateGalleryThumb(img.id);\n\t\t\t\n\t\t\t// Redraw active image if it's the one that just completed\n\t\t\tif (currentSession.activeImageIndex === currentSession.images.indexOf(img)) {\n\t\t\t\tdrawOverlaysForSession();\n\t\t\t}\n\t\t}\n\t);\n\n\t// All done - calculate aggregates and show report\n\tcurrentSession.status = updateSessionStatus(currentSession);\n\tcurrentSession.sessionAggregates = calculateSessionAggregates(currentSession);\n\n\tprogressBar.style.display = 'none';\n\n\t// Render session report\n\tconst reportHtml = renderReportUI(null, currentSession);\n\treportWrap.innerHTML = reportHtml;\n\n\t// Setup interactions\n\tconst activeImg = currentSession.images[currentSession.activeImageIndex];\n\tif (activeImg && activeImg.status === 'completed') {\n\t\tsetupReportInteractions(\n\t\t\treportWrap,\n\t\t\tactiveImg.detections,\n\t\t\t(detection) => {\n\t\t\t\thighlightedDetectionId = detection.id;\n\t\t\t\tdrawOverlaysForSession();\n\t\t\t},\n\t\t\t() => {\n\t\t\t\thighlightedDetectionId = null;\n\t\t\t\tdrawOverlaysForSession();\n\t\t\t}\n\t\t);\n\t}\n\n\t// Setup export buttons\n\tconst exportJSONBtn = document.getElementById('exportJSON');\n\tconst exportCSVBtn = document.getElementById('exportCSV');\n\t\n\tif (exportJSONBtn) {\n\t\texportJSONBtn.addEventListener('click', () => {\n\t\t\tconst json = exportSessionJSON(currentSession);\n\t\t\tdownloadFile(json, `session_${currentSession.sessionId}.json`, 'application/json');\n\t\t});\n\t}\n\t\n\tif (exportCSVBtn) {\n\t\texportCSVBtn.addEventListener('click', () => {\n\t\t\tconst csv = exportSessionCSV(currentSession);\n\t\t\tdownloadFile(csv, `session_${currentSession.sessionId}.csv`, 'text/csv');\n\t\t});\n\t}\n\n\tlogJson({ message: `Analysis complete. ${currentSession.sessionAggregates.totalDetections} detections across ${currentSession.images.filter(img => img.status === 'completed').length} images.` });\n\tisAnalyzing = false;\n}\n\nfunction renderGallery() {\n\tgallery.innerHTML = '';\n\tcurrentSession.images.forEach((img, index) => {\n\t\tconst thumb = document.createElement('div');\n\t\tthumb.className = 'gallery-thumb';\n\t\tthumb.id = `thumb-${img.id}`;\n\t\tif (index === currentSession.activeImageIndex) {\n\t\t\tthumb.classList.add('active');\n\t\t}\n\n\t\tconst imgEl = document.createElement('img');\n\t\timgEl.className = 'gallery-thumb-img';\n\t\tif (img.bitmap) {\n\t\t\timgEl.src = createThumbnailDataUrl(img.bitmap);\n\t\t}\n\n\t\tconst nameEl = document.createElement('div');\n\t\tnameEl.className = 'gallery-thumb-name';\n\t\tnameEl.textContent = img.filename;\n\n\t\tconst statusEl = document.createElement('div');\n\t\tstatusEl.className = `gallery-thumb-status ${img.status}`;\n\t\tstatusEl.id = `status-${img.id}`;\n\t\tstatusEl.textContent = img.status;\n\n\t\tthumb.appendChild(imgEl);\n\t\tthumb.appendChild(nameEl);\n\t\tthumb.appendChild(statusEl);\n\n\t\tthumb.addEventListener('click', () => {\n\t\t\tdisplaySessionImage(index);\n\t\t});\n\n\t\tgallery.appendChild(thumb);\n\t});\n}\n\nfunction updateGalleryThumb(imageId) {\n\tconst img = currentSession.images.find(i => i.id === imageId);\n\tif (!img) return;\n\n\tconst statusEl = document.getElementById(`status-${imageId}`);\n\tif (statusEl) {\n\t\tstatusEl.className = `gallery-thumb-status ${img.status}`;\n\t\tstatusEl.textContent = img.status;\n\t}\n}\n\nasync function displaySessionImage(index) {\n\tif (!currentSession || index <"+" 0 || index >= currentSession.images.length) return;\n\n\tcurrentSession.activeImageIndex = index;\n\tconst img = currentSession.images[index];\n\n\t// Update gallery active state\n\tdocument.querySelectorAll('.gallery-thumb').forEach((thumb, i) => {\n\t\tthumb.classList.toggle('active', i === index);\n\t});\n\n\t// Draw image\n\tif (img.bitmap) {\n\t\tcurrentImageBitmap = img.bitmap;\n\t\tnaturalW = img.naturalWidth;\n\t\tnaturalH = img.naturalHeight;\n\t\tcurrentDetections = img.detections || [];\n\t\tcurrentParsedData = img.parsedData;\n\n\t\tconst scale = calculateDisplayScale(naturalW, window.innerWidth);\n\t\tcanvas.width = Math.round(naturalW * scale);\n\t\tcanvas.height = Math.round(naturalH * scale);\n\n\t\tctx.clearRect(0, 0, canvas.width, canvas.height);\n\t\tctx.drawImage(img.bitmap, 0, 0, canvas.width, canvas.height);\n\n\t\tdrawOverlaysForSession();\n\t}\n}\n\nfunction drawOverlaysForSession() {\n\tif (!currentSession || !currentImageBitmap) return;\n\n\tconst img = currentSession.images[currentSession.activeImageIndex];\n\tif (!img || img.status !== 'completed') return;\n\n\tdrawOverlaysForData(img.bitmap, img.parsedData, img.detections, img.naturalWidth, img.naturalHeight);\n}\n\nfunction updateProgress() {\n\tif (!currentSession) return;\n\n\tconst progress = getSessionProgress(currentSession);\n\tprogressText.textContent = `Analyzing ${progress.done} of ${progress.total} images...`;\n\tprogressFill.style.width = `${progress.percentage}%`;\n\tprogressFill.textContent = `${progress.percentage}%`;\n}\n\nfunction createThumbnailDataUrl(bitmap) {\n\tconst thumbCanvas = document.createElement('canvas');\n\tconst thumbCtx = thumbCanvas.getContext('2d');\n\tconst maxHeight = 80;\n\tconst scale = maxHeight / bitmap.height;\n\tthumbCanvas.width = bitmap.width * scale;\n\tthumbCanvas.height = maxHeight;\n\tthumbCtx.drawImage(bitmap, 0, 0, thumbCanvas.width, thumbCanvas.height);\n\treturn thumbCanvas.toDataURL('image/jpeg', 0.7);\n}\n\nfunction drawOverlays() {\n\tif (!currentImageBitmap || !currentParsedData) return;\n\tdrawOverlaysForData(currentImageBitmap, currentParsedData, currentDetections, naturalW, naturalH);\n}\n\nfunction drawOverlaysForData(bitmap, parsedData, detections, natW, natH) {\n\tif (!bitmap || !parsedData) return;\n\n\t// Redraw base image\n\tctx.clearRect(0, 0, canvas.width, canvas.height);\n\tctx.drawImage(bitmap, 0, 0, canvas.width, canvas.height);\n\n\tconst scaleX = canvas.width / natW;\n\tconst scaleY = canvas.height / natH;\n\tconst coordSystem = ensureCoordSystem(parsedData, 'normalized_0_1000');\n\tconst coordOrigin = ensureCoordOrigin(parsedData, 'top-left');\n\n\tfor (const d of detections) {\n\t\tconst isHighlighted = highlightedDetectionId === d.id;\n\t\tconst color = colorForCategory(d.category);\n\t\tconst label = `${d.label ?? 'item'}${typeof d.confidence === 'number' ? ` (${(d.confidence*100).toFixed(0)}%)` : ''}`;\n\n\t\tif (isHighlighted) {\n\t\t\tctx.save();\n\t\t\tctx.shadowColor = col dules/jest-circus/build/run.js:121:9)\n    at run (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/node_modules/jest-circus/build/run.js:71:3)\n    at runAndTransformResultsToJestFormat (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/node_modules/jest-circus/build/legacy-code-todo-rewrite/jestAdapterInit.js:122:21)\n    at jestAdapter (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/node_modules/jest-circus/build/legacy-code-todo-rewrite/jestAdapter.js:79:19)\n    at runTestInternal (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/node_modules/jest-runner/build/runTest.js:367:16)\n    at runTest (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/node_modules/jest-runner/build/runTest.js:444:34)","status":"Killed","static":false,"testsCompleted":7,"killedBy":["80"],"coveredBy":["79","80","82","83","84","85","86"],"location":{"end":{"column":52,"line":23},"start":{"column":33,"line":23}}},{"id":"1083","mutatorName":"ArrowFunction","replacement":"() => undefined","status":"Survived","static":false,"testsCompleted":8,"coveredBy":["79","80","81","82","83","84","85","86"],"location":{"end":{"column":37,"line":24},"start":{"column":10,"line":24}}},{"id":"1084","mutatorName":"ArithmeticOperator","replacement":"b.count + a.count","status":"Survived","static":false,"testsCompleted":3,"coveredBy":["79","80","83"],"location":{"end":{"column":37,"line":24},"start":{"column":20,"line":24}}}],"source":"/* istanbul ignore file */\n\n/**\n * Calculate aggregates from detections (client-side to prevent LLM hallucination)\n */\nexport function calculateAggregates(detections) {\n\tconst countsByLabel = {};\n\tconst countsByCategory = {};\n\n\tfor (const det of detections) {\n\t\tconst label = det.label || 'unknown';\n\t\tconst category = det.category || 'other';\n\n\t\tcountsByLabel[label] = (countsByLabel[label] || 0) + 1;\n\t\tcountsByCategory[category] = (countsByCategory[category] || 0) + 1;\n\t}\n\n\treturn {\n\t\tcountsByLabel: Object.entries(countsByLabel)\n\t\t\t.map(([label, count]) => ({ label, count }))\n\t\t\t.sort((a, b) => b.count - a.count),\n\t\tcountsByCategory: Object.entries(countsByCategory)\n\t\t\t.map(([category, count]) => ({ category, count }))\n\t\t\t.sort((a, b) => b.count - a.count)\n\t};\n}\n\n/**\n * Render the interactive report UI for a session (multi-image or single-image)\n */\nexport function renderReportUI(data, session = null) {\n\t// Multi-image session mode\n\tif (session && session.images && session.images.length > 1) {\n\t\treturn renderSessionReport(session);\n\t}\n\n\t// Single-image mode (original behavior)\n\tconst detections = Array.isArray(data.detections) ? data.detections : [];\n\tconst insights = Array.isArray(data.global_insights) ? data.global_insights : [];\n\tconst aggregates = calculateAggregates(detections);\n\n\t// Separate safety issues and progress items\n\tconst safetyIssues = detections.filter(d => d.category === 'safety_issue');\n\tconst progressItems = detections.filter(d => d.category === 'progress' && d.progress);\n\n\tlet html = '';\n\n\t// Safety Issues Section (if any)\n\tif (safetyIssues.length > 0) {\n\t\thtml += renderSection('safety', '🚨 Safety Issues', renderSafetyCards(safetyIssues), false);\n\t}\n\n\t// Progress Section (if any detections or insights)\n\tconst progressInsights = insights.filter(i => i.category === 'progress');\n\tif (progressItems.length > 0 || progressInsights.length > 0) {\n\t\thtml += renderSection('progress', '📊 Progress', renderProgressSection(progressItems, progressInsights), true);\n\t}\n\n\t// All Detections Section\n\tif (detections.length > 0) {\n\t\thtml += renderSection('detections', '🔍 All Detections', renderDetectionCards(detections), true);\n\t}\n\n\t// Global Insights Section (non-progress)\n\tconst otherInsights = insights.filter(i => i.category !== 'progress');\n\tif (otherInsights.length > 0) {\n\t\thtml += renderSection('insights', '💡 Global Insights', renderInsights(otherInsights), true);\n\t}\n\n\t// Aggregates Section\n\tif (aggregates.countsByLabel.length > 0 || aggregates.countsByCategory.length > 0) {\n\t\thtml += renderSection('aggregates', '📈 Summary Statistics', renderAggregates(aggregates), true);\n\t}\n\n\treturn html;\n}\n\nfunction renderSection(id, title, content, collapsed = false) {\n\tconst collapsedClass = collapsed ? 'collapsed' : '';\n\tconst hiddenClass = collapsed ? 'hidden' : '';\n\treturn `\n\t\t<"+"div class=\"report-section\" data-section=\"${id}\">\n\t\t\t<"+"div class=\"report-header ${collapsedClass}\" data-section=\"${id}\">\n\t\t\t\t<"+"h3><"+"span class=\"toggle-icon\">▼<"+"/span> ${title}<"+"/h3>\n\t\t\t<"+"/div>\n\t\t\t<"+"div class=\"report-content ${hiddenClass}\" data-section=\"${id}\">\n\t\t\t\t${content}\n\t\t\t<"+"/div>\n\t\t<"+"/div>\n\t`;\n}\n\nfunction renderSafetyCards(safetyIssues) {\n\tconst cards = safetyIssues.map(det => {\n\t\tconst severity = det.safety?.severity || 'low';\n\t\tconst rule = det.safety?.rule || 'No rule specified';\n\t\tconst confidence = typeof det.confidence === 'number' ? (det.confidence * 100).toFixed(0) : '?';\n\n\t\treturn `\n\t\t\t<"+"div class=\"safety-card severity-${severity}\" data-detection-id=\"${det.id || ''}\">\n\t\t\t\t<"+"span class=\"safety-badge ${severity}\">${severity}<"+"/span>\n\t\t\t\t<"+"div class=\"safety-card-title\">${escapeHtml(det.label)}<"+"/div>\n\t\t\t\t<"+"div class=\"safety-card-rule\">${escapeHtml(rule)}<"+"/div>\n\t\t\t\t<"+"div style=\"margin-top:8px; font-size:12px; color:#9aa0b4;\">Confidence: ${confidence}%<"+"/div>\n\t\t\t<"+"/div>\n\t\t`;\n\t}).join('');\n\n\treturn `<"+"div class=\"safety-grid\">${cards}<"+"/div>`;\n}\n\nfunction renderProgressSection(progressItems, progressInsights) {\n\tlet html = '';\n\n\t// Progress from detections (regional)\n\tif (progressItems.length > 0) {\n\t\thtml += '<"+"h4 style=\"margin:0 0 12px; font-size:14px; color:#9aa0b4;\">Regional Progress<"+"/h4>';\n\t\tprogressItems.forEach(det => {\n\t\t\tconst phase = det.progress?.phase || 'Unknown phase';\n\t\t\tconst percent = det.progress?.percentComplete ?? 0;\n\t\t\tconst notes = det.progress?.notes || '';\n\t\t\tconst confidence = typeof det.confidence === 'number' ? (det.confidence * 100).toFixed(0) : '?';\n\n\t\t\thtml += `\n\t\t\t\t<"+"div class=\"progress-item\" data-detection-id=\"${det.id || ''}\">\n\t\t\t\t\t<"+"div class=\"progress-header\">\n\t\t\t\t\t\t<"+"span class=\"progress-label\">${escapeHtml(det.label)}: ${escapeHtml(phase)}<"+"/span>\n\t\t\t\t\t\t<"+"span class=\"progress-percent\">${percent.toFixed(0)}%<"+"/span>\n\t\t\t\t\t<"+"/div>\n\t\t\t\t\t<"+"div class=\"progress-bar-bg\">\n\t\t\t\t\t\t<"+"div class=\"progress-bar-fill\" style=\"width: ${percent}%\"><"+"/div>\n\t\t\t\t\t<"+"/div>\n\t\t\t\t\t${notes ? `<"+"div class=\"progress-notes\">${escapeHtml(notes)}<"+"/div>` : ''}\n\t\t\t\t\t<"+"div class=\"progress-notes\">Confidence: ${confidence}%<"+"/div>\n\t\t\t\t<"+"/div>\n\t\t\t`;\n\t\t});\n\t}\n\n\t// Progress from global insights\n\tif (progressInsights.length > 0) {\n\t\tif (progressItems.length > 0) {\n\t\t\thtml += '<"+"h4 style=\"margin:20px 0 12px; font-size:14px; color:#9aa0b4;\">Overall Progress<"+"/h4>';\n\t\t}\n\t\tprogressInsights.forEach(insight => {\n\t\t\tconst confidence = typeof insight.confidence === 'number' ? (insight.confidence * 100).toFixed(0) : '?';\n\t\t\t// Try to extract percentage from metrics or description\n\t\t\tlet percent = 0;\n\t\t\tif (insight.metrics) {\n\t\t\t\tconst pctMetric = insight.metrics.find(m => m.key.toLowerCase().includes('percent') || m.key.toLowerCase().includes('complete'));\n\t\t\t\tif (pctMetric) percent = pctMetric.value;\n\t\t\t}\n\n\t\t\thtml += `\n\t\t\t\t<"+"div class=\"progress-item\">\n\t\t\t\t\t<"+"div class=\"progress-header\">\n\t\t\t\t\t\t<"+"span class=\"progress-label\">${escapeHtml(insight.name)}<"+"/span>\n\t\t\t\t\t\t${percent > 0 ? `<"+"span class=\"progress-percent\">${percent.toFixed(0)}%<"+"/span>` : ''}\n\t\t\t\t\t<"+"/div>\n\t\t\t\t\t${percent > 0 ? `\n\t\t\t\t\t\t<"+"div class=\"progress-bar-bg\">\n\t\t\t\t\t\t\t<"+"div class=\"progress-bar-fill\" style=\"width: ${percent}%\"><"+"/div>\n\t\t\t\t\t\t<"+"/div>\n\t\t\t\t\t` : ''}\n\t\t\t\t\t<"+"div class=\"progress-notes\">${escapeHtml(insight.description)}<"+"/div>\n\t\t\t\t\t<"+"div class=\"progress-notes\">Confidence: ${confidence}%<"+"/div>\n\t\t\t\t<"+"/div>\n\t\t\t`;\n\t\t});\n\t}\n\n\treturn html || '<"+"p style=\"color:#9aa0b4;\">No progress information available.<"+"/p>';\n}\n\nfunction renderDetectionCards(detections) {\n\tconst cards = detections.map(det => {\n\t\tconst confidence = typeof det.confidence === 'number' ? (det.confidence * 100).toFixed(0) : '?';\n\t\tconst category = det.category || 'other';\n\t\tconst categoryLabel = category.replace(/_/g, ' ');\n\n\t\tlet attrsHtml = '';\n\t\tif (Array.isArray(det.attributes) && det.attributes.length > 0) {\n\t\t\tattrsHtml = '<"+"dl class=\"detection-card-attrs\">';\n\t\t\tdet.attributes.forEach(attr => {\n\t\t\t\tconst value = attr.valueNum ?? attr.valueStr ?? attr.valueBool ?? '—';\n\t\t\t\tconst unit = attr.unit ? ` ${attr.unit}` : '';\n\t\t\t\tattrsHtml += `<"+"dt>${escapeHtml(attr.name)}:<"+"/dt><"+"dd>${value}${unit}<"+"/dd><"+"br>`;\n\t\t\t});\n\t\t\tattrsHtml += '<"+"/dl>';\n\t\t}\n\n\t\treturn `\n\t\t\t<"+"div class=\"detection-card category-${category}\" data-detection-id=\"${det.id || ''}\">\n\t\t\t\t<"+"div class=\"detection-card-header\">\n\t\t\t\t\t<"+"div class=\"detection-card-label\">${escapeHtml(det.label)}<"+"/div>\n\t\t\t\t\t<"+"div class=\"detection-card-confidence\">${confidence}%<"+"/div>\n\t\t\t\t<"+"/div>\n\t\t\t\t<"+"div class=\"detection-card-category\">${escapeHtml(categoryLabel)}<"+"/div>\n\t\t\t\t${attrsHtml}\n\t\t\t<"+"/div>\n\t\t`;\n\t}).join('');\n\n\treturn `<"+"div class=\"detection-grid\">${cards}<"+"/div>`;\n}\n\nfunction renderInsights(insights) {\n\tconst cards = insights.map(insight => {\n\t\tconst confidence = typeof insight.confidence === 'number' ? (insight.confidence * 100).toFixed(0) : '?';\n\t\tlet metricsHtml = '';\n\n\t\tif (Array.isArray(insight.metrics) && insight.metrics.length > 0) {\n\t\t\tmetricsHtml = '<"+"div class=\"insight-metrics\">';\n\t\t\tinsight.metrics.forEach(metric => {\n\t\t\t\tconst unit = metric.unit ? ` ${metric.unit}` : '';\n\t\t\t\tmetricsHtml += `\n\t\t\t\t\t<"+"div class=\"insight-metric\">\n\t\t\t\t\t\t<"+"span class=\"insight-metric-key\">${escapeHtml(metric.key)}:<"+"/span>\n\t\t\t\t\t\t<"+"span class=\"insight-metric-value\">${metric.value}${unit}<"+"/span>\n\t\t\t\t\t<"+"/div>\n\t\t\t\t`;\n\t\t\t});\n\t\t\tmetricsHtml += '<"+"/div>';\n\t\t}\n\n\t\treturn `\n\t\t\t<"+"div class=\"insight-card\">\n\t\t\t\t<"+"div class=\"insight-card-title\">${escapeHtml(insight.name)}<"+"/div>\n\t\t\t\t<"+"div class=\"insight-card-desc\">${escapeHtml(insight.description)}<"+"/div>\n\t\t\t\t<"+"div class=\"insight-card-confidence\">Confidence: ${confidence}%<"+"/div>\n\t\t\t\t${metricsHtml}\n\t\t\t<"+"/div>\n\t\t`;\n\t}).join('');\n\n\treturn cards || '<"+"p style=\"color:#9aa0b4;\">No additional insights available.<"+"/p>';\n}\n\nfunction renderAggregates(aggregates) {\n\tlet html = '';\n\n\t// By Category\n\tif (aggregates.countsByCategory.length > 0) {\n\t\thtml += '<"+"h4 style=\"margin:0 0 12px; font-size:14px; color:#9aa0b4;\">By Category<"+"/h4>';\n\t\tconst maxCount = Math.max(...aggregates.countsByCategory.map(c => c.count));\n\n\t\taggregates.countsByCategory.forEach(item => {\n\t\t\tconst width = (item.count / maxCount) * 100;\n\t\t\tconst categoryLabel = item.category.replace(/_/g, ' ');\n\n\t\t\thtml += `\n\t\t\t\t<"+"div class=\"aggregate-bar\">\n\t\t\t\t\t<"+"div class=\"aggregate-bar-header\">\n\t\t\t\t\t\t<"+"span class=\"aggregate-bar-label\">${escapeHtml(categoryLabel)}<"+"/span>\n\t\t\t\t\t\t<"+"span class=\"aggregate-bar-count\">${item.count}<"+"/span>\n\t\t\t\t\t<"+"/div>\n\t\t\t\t\t<"+"div class=\"aggregate-bar-bg\">\n\t\t\t\t\t\t<"+"div class=\"aggregate-bar-fill category-${item.category}\" style=\ eturns {object} Aggregated statistics\n */\nexport function calculateSessionAggregates(session) {\n\tconst completedImages = session.images.filter(img => img.status === 'completed');\n\t\n\tlet totalDetections = 0;\n\tconst safetyIssues = { high: 0, medium: 0, low: 0 };\n\tconst categoryCounts = {};\n\tconst labelCounts = {};\n\tconst imageStats = [];\n\n\tcompletedImages.forEach(img => {\n\t\tconst detections = img.detections || [];\n\t\ttotalDetections += detections.length;\n\n\t\t// Per-image stats\n\t\tconst imgSafetyCount = detections.filter(d => d.category === 'safety_issue').length;\n\t\tconst imgProgressCount = detections.filter(d => d.category === 'progress').length;\n\t\t\n\t\timageStats.push({\n\t\t\timageId: img.id,\n\t\t\tfilename: img.filename,\n\t\t\tdetectionCount: detections.length,\n\t\t\tsafetyIssueCount: imgSafetyCount,\n\t\t\tprogressItemCount: imgProgressCount,\n\t\t\tstatus: img.status\n\t\t});\n\n\t\t// Aggregate detections\n\t\tdetections.forEach(det => {\n\t\t\tconst category = det.category || 'other';\n\t\t\tconst label = det.label || 'unknown';\n\n\t\t\t// Category counts\n\t\t\tcategoryCounts[category] = (categoryCounts[category] || 0) + 1;\n\n\t\t\t// Label counts\n\t\t\tlabelCounts[label] = (labelCounts[label] || 0) + 1;\n\n\t\t\t// Safety severity counts\n\t\t\tif (det.category === 'safety_issue' && det.safety?.severity) {\n\t\t\t\tconst severity = det.safety.severity.toLowerCase();\n\t\t\t\tif (severity === 'high' || severity === 'medium' || severity === 'low') {\n\t\t\t\t\tsafetyIssues[severity]++;\n\t\t\t\t}\n\t\t\t}\n\t\t});\n\t});\n\n\treturn {\n\t\ttotalDetections,\n\t\tsafetyIssues,\n\t\tcategoryCounts: Object.entries(categoryCounts)\n\t\t\t.map(([category, count]) => ({ category, count }))\n\t\t\t.sort((a, b) => b.count - a.count),\n\t\tlabelCounts: Object.entries(labelCounts)\n\t\t\t.map(([label, count]) => ({ label, count }))\n\t\t\t.sort((a, b) => b.count - a.count),\n\t\timageStats\n\t};\n}\n\n/**\n * Update session status based on image states\n * @param {object} session - Session state\n * @returns {string} Updated status\n */\nexport function updateSessionStatus(session) {\n\tconst statuses = session.images.map(img => img.status);\n\tconst allDone = statuses.every(s => s === 'completed' || s === 'error');\n\tconst anyError = statuses.some(s => s === 'error');\n\tconst anyCompleted = statuses.some(s => s === 'completed');\n\n\tif (allDone) {\n\t\treturn anyError && anyCompleted ? 'partial_failure' : anyError ? 'error' : 'completed';\n\t}\n\treturn 'analyzing';\n}\n\n/**\n * Get progress metrics for the session\n * @param {object} session - Session state\n * @returns {object} Progress information\n */\nexport function getSessionProgress(session) {\n\tconst total = session.images.length;\n\tconst completed = session.images.filter(img => img.status === 'completed').length;\n\tconst error = session.images.filter(img => img.status === 'error').length;\n\tconst analyzing = session.images.filter(img => img.status === 'analyzing').length;\n\tconst queued = session.images.filter(img => img.status === 'queued').length;\n\n\treturn {\n\t\ttotal,\n\t\tcompleted,\n\t\terror,\n\t\tanalyzing,\n\t\tqueued,\n\t\tdone: completed + error,\n\t\tpercentage: Math.round(((completed + error) / total) * 100)\n\t};\n}\n"},"src/math.js":{"language":"javascript","mutants":[{"id":"1050","mutatorName":"BlockStatement","replacement":"{}","statusReason":"Error: expect(received).toEqual(expected) // deep equality\n\n- Expected  - 4\n+ Received  + 4\n\n  Object {\n-   \"height\": 40,\n-   \"width\": 80,\n-   \"x\": 20,\n-   \"y\": 20,\n+   \"height\": undefined,\n+   \"width\": undefined,\n+   \"x\": undefined,\n+   \"y\": undefined,\n  }\n    at Object.toEqual (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/.stryker-tmp/sandbox-LmX06x/src/index.test.js:25:19)\n    at Promise.then.completed (/home/runner/work/gemini-vlm-demo/gemini-vlm-demo/node_modules/jest-circus/build/utils.js:298:28)\n    at new Promise (<"+  down)\n */\nexport function calculateDisplayScale(naturalWidth, viewportWidth, padding = 60) {\n\tif (typeof naturalWidth !== 'number' || !Number.isFinite(naturalWidth) || naturalWidth <"+"= 0) {\n\t\tthrow new Error('Invalid naturalWidth: must be positive finite number');\n\t}\n\tif (typeof viewportWidth !== 'number' || !Number.isFinite(viewportWidth) || viewportWidth <"+"= 0) {\n\t\tthrow new Error('Invalid viewportWidth: must be positive finite number');\n\t}\n\tif (typeof padding !== 'number' || !Number.isFinite(padding) || padding <"+" 0) {\n\t\tthrow new Error('Invalid padding: must be non-negative finite number');\n\t}\n\t\n\tconst maxW = Math.min(viewportWidth - padding, naturalWidth);\n\treturn maxW / naturalWidth;\n}\n\n/**\n * Format JSON output with optional note header.\n * @param {object} obj - Object to stringify\n * @param {string} [note] - Optional note to prepend\n * @returns {string} Formatted JSON string\n */\nexport function formatJsonOutput(obj, note) {\n\tconst head = note ? `// ${note}\\n` : '';\n\treturn head + JSON.stringify(obj, null, 2);\n}\n\n/**\n * Parse base64 data URL to extract the base64 content.\n * @param {string} dataUrl - Data URL string (e.g., \"data:image/jpeg;base64,ABC123...\")\n * @returns {string} Base64 content without the data URL prefix\n * @throws {Error} If dataUrl format is invalid\n */\nexport function extractBase64FromDataUrl(dataUrl) {\n\tif (typeof dataUrl !== 'string') {\n\t\tthrow new Error('Invalid dataUrl: must be a string');\n\t}\n\tconst parts = dataUrl.split(',');\n\tif (parts.length <"+" 2) {\n\t\tthrow new Error('Invalid dataUrl format: expected \"data:mime;base64,content\"');\n\t}\n\treturn parts[1];\n}\n\n/**\n * Validate and prepare detection data for rendering.\n * Ensures required image metadata is present.\n * @param {object} parsed - Parsed detection response\n * @param {number} naturalWidth - Original image width\n * @param {number} naturalHeight - Original image height\n * @returns {object} Enhanced detection data with guaranteed image dimensions\n */\nexport function prepareDetectionData(parsed, naturalWidth, naturalHeight) {\n\tif (!parsed || typeof parsed !== 'object') {\n\t\tthrow new Error('Invalid parsed data: must be an object');\n\t}\n\tif (typeof naturalWidth !== 'number' || !Number.isFinite(naturalWidth) || naturalWidth <"+"= 0) {\n\t\tthrow new Error('Invalid naturalWidth: must be positive finite number');\n\t}\n\tif (typeof naturalHeight !== 'number' || !Number.isFinite(naturalHeight) || naturalHeight <"+"= 0) {\n\t\tthrow new Error('Invalid naturalHeight: must be positive finite number');\n\t}\n\n\t// Fill in image.width/height if missing (helps downstream)\n\tif (!parsed.image) parsed.image = {};\n\tif (parsed.image.width == null)  parsed.image.width  = naturalWidth;\n\tif (parsed.image.height == null) parsed.image.height = naturalHeight;\n\n\treturn parsed;\n}\n"}},"schemaVersion":"1.0","thresholds":{"high":90,"low":60,"break":50},"testFiles":{"src/ui-utils.test.js":{"tests":[{"id":"0","name":"colorForCategory returns correct color for safety_issue","location":{"start":{"column":3,"line":11}}},{"id":"1","name":"colorForCategory returns correct color for facility_asset","location":{"start":{"column":3,"line":15}}},{"id":"2","name":"colorForCategory returns correct color for progress","location":{"start":{"column":3,"line":19}}},{"id":"3","name":"colorForCategory returns correct color for object","location":{"start":{"column":3,"line":23}}},{"id":"4","name":"colorForCategory returns default color for unknown category","location":{"start":{"column":3,"line":27}}},{"id":"5","name":"extractJSONFromResponse extracts JSON from valid Gemini response","location":{"start":{"column":3,"line":36}}},{"id":"6","name":"extractJSONFromResponse strips markdown json code blocks","location":{"start":{"column":3,"line":48}}},{"id":"7","name":"extractJSONFromResponse handles whitespace around JSON","location":{"start":{"column":3,"line":60}}},{"id":"8","name":
