 note is undefined","location":{"start":{"column":3,"line":191}}},{"id":"25","name":"formatJsonOutput handles empty objects","location":{"start":{"column":3,"line":198}}},{"id":"26","name":"formatJsonOutput handles arrays","location":{"start":{"column":3,"line":203}}},{"id":"27","name":"extractBase64FromDataUrl extracts base64 content from data URL","location":{"start":{"column":3,"line":210}}},{"id":"28","name":"extractBase64FromDataUrl handles data URLs with different MIME types","location":{"start":{"column":3,"line":215}}},{"id":"29","name":"extractBase64FromDataUrl handles data URLs with charset","location":{"start":{"column":3,"line":220}}},{"id":"30","name":"extractBase64FromDataUrl throws error for non-string input","location":{"start":{"column":3,"line":225}}},{"id":"31","name":"extractBase64FromDataUrl throws error for invalid format without comma","location":{"start":{"column":3,"line":231}}},{"id":"32","name":"extractBase64FromDataUrl throws error for empty string","location":{"start":{"column":3,"line":235}}},{"id":"33","name":"prepareDetectionData adds missing image dimensions","location":{"start":{"column":3,"line":241}}},{"id":"34","name":"prepareDetectionData preserves existing image dimensions","location":{"start":{"column":3,"line":248}}},{"id":"35","name":"prepareDetectionData creates image object if missing","location":{"start":{"column":3,"line":255}}},{"id":"36","name":"prepareDetectionData preserves other properties in parsed data","location":{"start":{"column":3,"line":262}}},{"id":"37","name":"prepareDetectionData handles null width/height in image object","location":{"start":{"column":3,"line":273}}},{"id":"38","name":"prepareDetectionData handles undefined width/height in image object","location":{"start":{"column":3,"line":280}}},{"id":"39","name":"prepareDetectionData throws error for invalid parsed data","location":{"start":{"column":3,"line":287}}},{"id":"40","name":"prepareDetectionData throws error for invalid naturalWidth","location":{"start":{"column":3,"line":293}}},{"id":"41","name":"prepareDetectionData throws error for invalid naturalHeight","location":{"start":{"column":3,"line":299}}},{"id":"42","name":"prepareDetectionData mutates the original object","location":{"start":{"column":3,"line":305}}}],"source":"import {\n\tcolorForCategory,\n\textractJSONFromResponse,\n\tcalculateDisplayScale,\n\tformatJsonOutput,\n\textractBase64FromDataUrl,\n\tprepareDetectionData\n} from './ui-utils.js';\n\ndescribe('colorForCategory', () => {\n\tit('returns correct color for safety_issue', () => {\n\t\texpect(colorForCategory('safety_issue')).toBe('#ff5b5b');\n\t});\n\n\tit('returns correct color for facility_asset', () => {\n\t\texpect(colorForCategory('facility_asset')).toBe('#5bd1ff');\n\t});\n\n\tit('returns correct color for progress', () => {\n\t\texpect(colorForCategory('progress')).toBe('#a1ff5b');\n\t});\n\n\tit('returns correct color for object', () => {\n\t\texpect(colorForCategory('object')).toBe('#ffd05b');\n\t});\n\n\tit('returns default color for unknown category', () => {\n\t\texpect(colorForCategory('unknown')).toBe('#cccccc');\n\t\texpect(colorForCategory('')).toBe('#cccccc');\n\t\texpect(colorForCategory(null)).toBe('#cccccc');\n\t\texpect(colorForCategory(undefined)).toBe('#cccccc');\n\t});\n});\n\ndescribe('extractJSONFromResponse', () => {\n\tit('extracts JSON from valid Gemini response', () => {\n\t\tconst resp = {\n\t\t\tcandidates: [{\n\t\t\t\tcontent: {\n\t\t\t\t\tparts: [{ text: '{\"detections\": []}' }]\n\t\t\t\t}\n\t\t\t}]\n\t\t};\n\t\tconst result = extractJSONFromResponse(resp);\n\t\texpect(result).toEqual({ detections: [] });\n\t});\n\n\tit('strips markdown json code blocks', () => {\n\t\tconst resp = {\n\t\t\tcandidates: [{\n\t\t\t\tcontent: {\n\t\t\t\t\tparts: [{ text: '```json\\n{\"detections\": []}\\n```' }]\n\t\t\t\t}\n\t\t\t}]\n\t\t};\n\t\tconst result = extractJSONFromResponse(resp);\n\t\texpect(result).toEqual({ detections: [] });\n\t});\n\n\tit('handles whitespace around JSON', () => {\n\t\tconst resp = {\n\t\t\tcandidates: [{\n\t\t\t\tcontent: {\n\t\t\t\t\tparts: [{ text: '  \\n{\"detections\": []}\\n  ' }]\n\t\t\t\t}\n\t\t\t}]\n\t\t};\n\t\tconst result = extractJSONFromResponse(resp);\n\t\texpect(result).toEqual({ detections: [] });\n\t});\n\n\tit('throws error when no candidates', () => {\n\t\texpect(() => extractJSONFromResponse({})).toThrow('No text JSON found in response.');\n\t});\n\n\tit('throws error when candidates array is empty', () => {\n\t\texpect(() => extractJSONFromResponse({ candidates: [] })).toThrow('No text JSON found in response.');\n\t});\n\n\tit('throws error when no text part found', () => {\n\t\tconst resp = {\n\t\t\tcandidates: [{\n\t\t\t\tcontent: {\n\t\t\t\t\tparts: [{ image: 'data' }]\n\t\t\t\t}\n\t\t\t}]\n\t\t};\n\t\texpect(() => extractJSONFromResponse(resp)).toThrow('No text JSON found in response.');\n\t});\n\n\tit('throws error on invalid JSON', () => {\n\t\tconst resp = {\n\t\t\tcandidates: [{\n\t\t\t\tcontent: {\n\t\t\t\t\tparts: [{ text: 'not valid json' }]\n\t\t\t\t}\n\t\t\t}]\n\t\t};\n\t\texpect(() => extractJSONFromResponse(resp)).toThrow();\n\t});\n\n\tit('finds text part when multiple parts present', () => {\n\t\tconst resp = {\n\t\t\tcandidates: [{\n\t\t\t\tcontent: {\n\t\t\t\t\tparts: [\n\t\t\t\t\t\t{ image: 'data' },\n\t\t\t\t\t\t{ text: '{\"found\": true}' },\n\t\t\t\t\t\t{ text: 'second text' }\n\t\t\t\t\t]\n\t\t\t\t}\n\t\t\t}]\n\t\t};\n\t\tconst result = extractJSONFromResponse(resp);\n\t\texpect(result).toEqual({ found: true });\n\t});\n});\n\ndescribe('calculateDisplayScale', () => {\n\tit('returns 1.0 when image fits within viewport', () => {\n\t\texpect(calculateDisplayScale(800, 1920, 60)).toBe(1.0);\n\t});\n\n\tit('scales down when image exceeds viewport', () => {\n\t\tconst scale = calculateDisplayScale(2000, 1920, 60);\n\t\texpect(scale).toBe((1920 - 60) / 2000);\n\t\texpect(scale).toBeLessThan(1.0);\n\t});\n\n\tit('uses custom padding', () => {\n\t\tconst scale = calculateDisplayScale(1000, 1920, 100);\n\t\t// When naturalWidth (1000) <"+" viewportWidth - padding (1820), scale is 1.0\n\t\texpect(scale).toBe(1.0);\n\t});\n\n\tit('defaults padding to 60', () => {\n\t\tconst scale1 = calculateDisplayScale(1000, 1920);\n\t\tconst scale2 = calculateDisplayScale(1000, 1920, 60);\n\t\texpect(scale1).toBe(scale2);\n\t});\n\n\tit('handles small viewport gracefully', () => {\n\t\tconst scale = calculateDisplayScale(500, 400, 60);\n\t\texpect(scale).toBe((400 - 60) / 500);\n\t});\n\n\tit('throws error for invalid naturalWidth', () => {\n\t\texpect(() => calculateDisplayScale(0, 1920)).toThrow('Invalid naturalWidth');\n\t\texpect(() => calculateDisplayScale(-100, 1920)).toThrow('Invalid naturalWidth');\n\t\texpect(() => calculateDisplayScale(NaN, 1920)).toThrow('Invalid naturalWidth');\n\t\texpect(() => calculateDisplayScale(Infinity, 1920)).toThrow('Invalid naturalWidth');\n\t\texpect(() => calculateDisplayScale('800', 1920)).toThrow('Invalid naturalWidth');\n\t});\n\n\tit('throws error for invalid viewportWidth', () => {\n\t\texpect(() => calculateDisplayScale(800, 0)).toThrow('Invalid viewportWidth');\n\t\texpect(() => calculateDisplayScale(800, -1920)).toThrow('Invalid viewportWidth');\n\t\texpect(() => calculateDisplayScale(800, NaN)).toThrow('Invalid viewportWidth');\n\t});\n\n\tit('throws error for invalid padding', () => {\n\t\texpect(() => calculateDisplayScale(800, 1920, -10)).toThrow('Invalid padding');\n\t\texpect(() => calculateDisplayScale(800, 1920, NaN)).toThrow('Invalid padding');\n\t\texpect(() => calculateDisplayScale(800, 1920, Infinity)).toThrow('Invalid padding');\n\t});\n});\n\ndescribe('formatJsonOutput', () => {\n\tit('formats JSON with pretty printing', () => {\n\t\tconst obj = { key: 'value', nested: { data: 123 } };\n\t\tconst result = formatJsonOutput(obj);\n\t\texpect(result).toContain('\"key\": \"value\"');\n\t\texpect(result).toContain('\"nested\"');\n\t\texpect(result).toContain('  '); // indentation\n\t});\n\n\tit('adds note header when provided', () => {\n\t\tconst obj = { status: 'ok' };\n\t\tconst result = formatJsonOutput(obj, 'Success');\n\t\texpect(result.startsWith('// Success\\n')).toBe(true);\n\t\texpect(result).toContain('\"status\": \"ok\"');\n\t});\n\n\tit('does not add header when note is null', () => {\n\t\tconst obj = { status: 'ok' };\n\t\tconst result = formatJsonOutput(obj, null);\n\t\texpect(result).not.toContain('//');\n\t\texpect(result.startsWith('{')).toBe(true);\n\t});\n\n\tit('does not add header when note is undefined', () => {\n\t\tconst obj = { status: 'ok' };\n\t\tconst result = formatJsonOutput(obj);\n\t\texpect(result).not.toContain('//');\n\t\texpect(result.startsWith('{')).toBe(true);\n\t});\n\n\tit('handles empty objects', () => {\n\t\tconst result = formatJsonOutput({});\n\t\texpect(result).toBe('{}');\n\t});\n\n\tit('handles arrays', () => {\n\t\tconst result = formatJsonOutput([1, 2, 3]);\n\t\texpect(result).toContain('[\\n  1,\\n  2,\\n  3\\n]');\n\t});\n});\n\ndescribe('extractBase64FromDataUrl', () => {\n\tit('extracts base64 content from data URL', () => {\n\t\tconst dataUrl = 'data:image/jpeg;base64,ABC123XYZ';\n\t\texpect(extractBase64FromDataUrl(dataUrl)).toBe('ABC123XYZ');\n\t});\n\n\tit('handles data URLs with different MIME types', () => {\n\t\tconst dataUrl = 'data:image/png;base64,PNG_DATA_HERE';\n\t\texpect(extractBase64FromDataUrl(dataUrl)).toBe('PNG_DATA_HERE');\n\t});\n\n\tit('handles data URLs with charset', () => {\n\t\tconst dataUrl = 'data:text/plain;charset=utf-8;base64,TEXT_DATA';\n\t\texpect(extractBase64FromDataUrl(dataUrl)).toBe('TEXT_DATA');\n\t});\n\n\tit('throws error for non-string input', () => {\n\t\texpect(() => extractBase64FromDataUrl(123)).toThrow('Invalid dataUrl: must be a string');\n\t\texpect(() => extractBase64FromDataUrl(null)).toThrow('Invalid dataUrl: must be a string');\n\t\texpect(() => extractBase64FromDataUrl(undefined)).toThrow('Invalid dataUrl: must be a string');\n\t});\n\n\tit('throws error for invalid format without comma', () => {\n\t\texpect(() => extractBase64FromDataUrl('invalidformat')).toThrow('Invalid dataUrl format');\n\t});\n\n\tit('throws error for empty string', () => {\n\t\texpect(() => extractBase64FromDataUrl('')).toThrow('Invalid dataUrl format');\n\t});\n});\n\ndescribe('prepareDetectionData', () => {\n\tit('adds missing image dimensions', () => {\n\t\tconst parsed = { detections: [] };\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result.image.width).toBe(1920);\n\t\texpect(result.image.height).toBe(1080);\n\t});\n\n\tit('preserves existing image dimensions', () => {\n\t\tconst parsed = { image: { width: 800, height: 600 }, detections: [] };\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result.image.width).toBe(800);\n\t\texpect(result.image.height).toBe(600);\n\t});\n\n\tit('creates image object if missing', () => {\n\t\tconst parsed = { detections: [] };\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result.image).toBeDefined();\n\t\texpect(typeof result.image).toBe('object');\n\t});\n\n\tit('preserves other properties in parsed data', () => {\n\t\tconst parsed = { \n\t\t\tdetections: [{ label: 'test' }], \n\t\t\tmetadata: { source: 'test' },\n\t\t\timage: {}\n\t\t};\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result.detections).toEqual([{ label: 'test' }]);\n\t\texpect(result.metadata).toEqual({ source: 'test' });\n\t});\n\n\tit('handles null width/height in image object', () => {\n\t\tconst parsed = { image: { width: null, height: null } };\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result.image.width).toBe(1920);\n\t\texpect(result.image.height).toBe(1080);\n\t});\n\n\tit('handles undefined width/height in image object', () => {\n\t\tconst parsed = { image: {} };\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result.image.width).toBe(1920);\n\t\texpect(result.image.height).toBe(1080);\n\t});\n\n\tit('throws error for invalid parsed data', () => {\n\t\texpect(() => prepareDetectionData(null, 1920, 1080)).toThrow('Invalid parsed data');\n\t\texpect(() => prepareDetectionData(undefined, 1920, 1080)).toThrow('Invalid parsed data');\n\t\texpect(() => prepareDetectionData('string', 1920, 1080)).toThrow('Invalid parsed data');\n\t});\n\n\tit('throws error for invalid naturalWidth', () => {\n\t\texpect(() => prepareDetectionData({}, 0, 1080)).toThrow('Invalid naturalWidth');\n\t\texpect(() => prepareDetectionData({}, -100, 1080)).toThrow('Invalid naturalWidth');\n\t\texpect(() => prepareDetectionData({}, NaN, 1080)).toThrow('Invalid naturalWidth');\n\t});\n\n\tit('throws error for invalid naturalHeight', () => {\n\t\texpect(() => prepareDetectionData({}, 1920, 0)).toThrow('Invalid naturalHeight');\n\t\texpect(() => prepareDetectionData({}, 1920, -100)).toThrow('Invalid naturalHeight');\n\t\texpect(() => prepareDetectionData({}, 1920, Infinity)).toThrow('Invalid naturalHeight');\n\t});\n\n\tit('mutates the original object', () => {\n\t\tconst parsed = { detections: [] };\n\t\tconst result = prepareDetectionData(parsed, 1920, 1080);\n\t\texpect(result).toBe(parsed); // Same reference\n\t\texpect(parsed.image.width).toBe(1920);\n\t});\n});\n"},"src/index.test.js":{"tests":[{"id":"43","name":"geometry helpers Gemini bbox array format [ymin, xmin, ymax, xmax] toCanvasBox parses Gemini array format and converts to canvas coordinates","location":{"start":{"column":4,"line":14}}},{"id":"44","name":"geometry helpers Gemini bbox array format [ymin, xmin, ymax, xmax] toCanvasBox handles top-left origin correctly (Gemini default)","location":{"start":{"column":4,"line":27}}},{"id":"45","name":"geometry helpers Gemini bbox array format [ymin, xmin, ymax, xmax] toCanvasBox returns null for invalid array","location":{"start":{"column":4,"line":37}}},{"id":"46","name":"geometry helpers Legacy object format {x, y, width, height} toCanvasBox still supports object format for backward compatibility","location":{"start":{"column":4,"line":44}}},{"id":"47","name":"geometry helpers Legacy object format {x, y, width, height} toCanvasBox converts bottom-left origin to top-left when specified","location":{"start":{"column":4,"line":50}}},{"id":"48","name":"geometry helpers toCanvasBox returns null when bbox is missing","location":{"start":{"column":3,"line":58}}},{"id":"49","name":"geometry helpers toCanvasBox respects normalized_0_1000 coord system and scales output","location":{"start":{"column":3,"line":62}}},{"id":"50","name":"geometry helpers toCanvasBox clamps values that exceed the canvas bounds","location":{"start":{"column":4,"line":68}}},{"id":"51","name":"geometry helpers toCanvasBox returns null when bbox contains non-finite values","location":{"start":{"column":4,"line":74}}},{"id":"52","name":"geometry helpers toCanvasBox falls back to unit scale and skips clamping when scale/canvas values are missing","location":{"start":{"column":4,"line":79}}},{"id":"53","name":"geometry helpers toCanvasPolygon flips Y when origin is bottom-left","location":{"start":{"column":4,"line":85}}},{"id":"54","name":"geometry helpers toCanvasPolygon maps normalized coordinates correctly","location":{"start":{"column":4,"line":99}}},{"id":"55","name":"geometry helpers toCanvasPolygon returns null when fewer than three valid points remain after filtering","location":{"start":{"column":4,"line":113}}},{"id":"56","name":"geometry helpers toCanvasPolygon returns null when poly is not an array","location":{"start":{"column":4,"line":123}}},{"id":"57","name":"geometry helpers toCanvasPolygon defaults scale factors when display scales are missing","location":{"start":{"column":4,"line":127}}},{"id":"58","name":"geometry helpers ensureCoordOrigin falls back to detections when image metadata missing","location":{"start":{"column":3,"line":141}}},{"id":"59","name":"geometry helpers ensureCoordSystem defaults to normalized_0_1000 (Gemini standard)","location":{"start":{"column":3,"line":149}}},{"id":"60","name":"geometry helpers ensureCoordOrigin defaults to top-left (Gemini standard)","location":{"start":{"column":3,"line":154}}},{"id":"61","name":"geometry helpers clamp limits values to provided range and handles non-finite inputs","location":{"start":{"column":8,"line":156}}},{"id":"62","name":"geometry helpers Integration: Full Gemini response flow Complete flow from Gemini response to canvas coordinates","location":{"start":{"column":4,"line":163}}}],"source":"import {\n\ttoCanvasBox,\n\ttoCanvasPolygon,\n\tensureCoordOrigin,\n\tensureCoordSystem\n} from './geometry.js';\nimport { clamp } from './math.js';\n\ndescribe('geometry helpers', () => {\n\tconst naturalW = 200;\n\tconst naturalH = 100;\n\n\tdescribe('Gemini bbox array format [ymin, xmin, ymax, xmax]', () => {\n\t\ttest('toCanvasBox parses Gemini array format and converts to canvas coordinates', () => {\n\t\t\t// Gemini format: [ymin, xmin, ymax, xmax] normalized 0-1000\n\t\t\t// Example: [200, 100, 600, 500] on a 1000x1000 normalized space\n\t\t\t// Image: 200x100 pixels\n\t\t\tconst geminiBbox = [200, 100, 600, 500];\n\t\t\tconst result = toCanvasBox(geminiBbox, 'normalized_0_1000', 1, 1, naturalW, naturalH, 'top-left', 200, 100);\n\t\t\t\n\t\t\t// Expected: ymin=200/1000*100=20, xmin=100/1000*200=20\n\t\t\t//           ymax=600/1000*100=60, xmax=500/1000*200=100\n\t\t\t//           x=20, y=20, width=80, height=40\n\t\t\texpect(result).toEqual({ x: 20, y: 20, width: 80, height: 40 });\n\t\t});\n\n\t\ttest('toCanvasBox handles top-left origin correctly (Gemini default)', () => {\n\t\t\tconst geminiBbox = [100, 200, 300, 400]; // [ymin, xmin, ymax, xmax]\n\t\t\tconst result = toCanvasBox(geminiBbox, 'normalized_0_1000', 1, 1, naturalW, naturalH, 'top-left', 200, 100);\n\t\t\t\n\t\t\t// ymin=100/1000*100=10, xmin=200/1000*200=40\n\t\t\t// ymax=300/1000*100=30, xmax=400/1000*200=80\n\t\t\t// x=40, y=10, width=40, height=20\n\t\t\texpect(result).toEqual({ x: 40, y: 10, width: 40, height: 20 });\n\t\t});\n\n\t\ttest('toCanvasBox returns null for invalid array', () => {\n\t\t\texpect(toCanvasBox([1, 2, 3], 'normalized_0_1000', 1, 1, naturalW, naturalH)).toBeNull();\n\t\t\texpect(toCanvasBox([NaN, 100, 200, 300], 'normalized_0_1000', 1, 1, naturalW, naturalH)).toBeNull();\n\t\t});\n\t});\n\n\tdescribe('Legacy object format {x, y, width, height}', () => {\n\t\ttest('toCanvasBox still supports object format for backward compatibility', () => {\n\t\t\tconst bbox = { x: 10, y: 20, width: 30, height: 40 };\n\t\t\tconst result = toCanvasBox(bbox, 'pixel', 1, 1, naturalW, naturalH, 'top-left', 200, 100);\n\t\t\texpect(result).toEqual({ x: 10, y: 20, width: 30, height: 40 });\n\t\t});\n\n\t\ttest('toCanvasBox converts bottom-left origin to top-left when specified', () => {\n\t\t\tconst bbox = { x: 10, y: 20, width: 30, height: 40 };\n\t\t\tconst result = toCanvasBox(bbox, 'pixel', 1, 1, naturalW, naturalH, 'bottom-left', 200, 100);\n\t\t\t// bottom-left: y = imgH - (y + height) = 100 - (20 + 40) = 40\n\t\t\texpect(result).toEqual({ x: 10, y: 40, width: 30, height: 40 });\n\t\t});\n\t});\n\n\ttest('toCanvasBox returns null when bbox is missing', () => {\n\t\texpect(toCanvasBox(null, 'pixel', 1, 1, naturalW, naturalH)).toBeNull();\n\t});\n\n\ttest('toCanvasBox respects normalized_0_1000 coord system and scales output', () => {\n\t\tconst bbox = { x: 500, y: 250, width: 100, height: 200 };\n\t\tconst result = toCanvasBox(bbox, 'normalized_0_1000', 0.5, 0.5, 400, 200, 'top-left', 200, 100);\n\t\texpect(result).toEqual({ x: 100, y: 25, width: 20, height: 20 });\n\t});\n\n  test('toCanvasBox clamps values that exceed the canvas bounds', () => {\n    const bbox = { x: 180, y: 90, width: 50, height: 30 };\n    const result = toCanvasBox(bbox, 'pixel', 1, 1, naturalW, naturalH, 'top-left', 200, 100);\n    expect(result).toEqual({ x: 180, y: 90, width: 20, height: 10 });\n  });\n\n  test('toCanvasBox returns null when bbox contains non-finite values', () => {\n    const bbox = { x: 0, y: Number.NaN, width: 10, height: 10 };\n    expect(toCanvasBox(bbox, 'pixel', 1, 1, naturalW, naturalH, 'top-left', 200, 100)).toBeNull();\n  });\n\n  test('toCanvasBox falls back to unit scale and skips clamping when scale/canvas values are missing', () => {\n    const bbox = { x: 10, y: 10, width: 10, height: 10 };\n    const result = toCanvasBox(bbox, 'pixel', undefined, undefined, naturalW, naturalH, 'top-left');\n    expect(result).toEqual({ x: 10, y: 10, width: 10, height: 10 });\n  });\n\n  test('toCanvasPolygon flips Y when origin is bottom-left', () => {\n    const polygon = [\n      { x: 0, y: 0 },\n      { x: 100, y: 0 },\n      { x: 50, y: 50 }\n    ];\n    const result = toCanvasPolygon(polygon, 'pixel', 1, 1, naturalW, naturalH, 'bottom-left');\n    expect(result).toEqual([\n      { x: 0, y: 100 },\n      { x: 100, y: 100 },\n      { x: 50, y: 50 }\n    ]);\n  });\n\n  test('toCanvasPolygon maps normalized coordinates correctly', () => {\n    const polygon = [\n      { x: 0, y: 0 },\n      { x: 1000, y: 0 },\n      { x: 500, y: 1000 }\n    ];\n    const result = toCanvasPolygon(polygon, 'normalized_0_1000', 0.5, 0.5, 400, 200, 'top-left');\n    expect(result).toEqual([\n      { x: 0, y: 0 },\n      { x: 200, y: 0 },\n      { x: 100, y: 100 }\n    ]);\n  });\n\n  test('toCanvasPolygon returns null when fewer than three valid points remain after filtering', () => {\n    const polygon = [\n      { x: 0, y: 0 },\n      { x: Number.NaN, y: 5 },\n      { x: 10, y: Number.POSITIVE_INFINITY }\n    ];\n    const result = toCanvasPolygon(polygon, 'pixel', 1, 1, naturalW, naturalH, 'top-left');\n    expect(result).toBeNull();\n  });\n\n  test('toCanvasPolygon returns null when poly is not an array', () => {\n    expect(toCanvasPolygon(null, 'pixel', 1, 1, naturalW, naturalH, 'top-left')).toBeNull();\n  });\n\n  test('toCanvasPolygon defaults scale factors when display scales are missing', () => {\n    const polygon = [\n      { x: 0, y: 0 },\n      { x: 0, y: 50 },\n      { x: 50, y: 50 }\n    ];\n    const result = toCanvasPolygon(polygon, 'pixel', undefined, undefined, naturalW, naturalH, 'top-left');\n    expect(result).toEqual([\n      { x: 0, y: 0 },\n      { x: 0, y: 50 },\n      { x: 50, y: 50 }\n    ]);\n  });\n\n\ttest('ensureCoordOrigin falls back to detections when image metadata missing', () => {\n\t\tconst parsed = {\n\t\t\timage: {},\n\t\t\tdetections: [{ coordOrigin: 'bottom-left' }]\n\t\t};\n\t\texpect(ensureCoordOrigin(parsed, 'top-left')).toBe('bottom-left');\n\t});\n\n\ttest('ensureCoordSystem defaults to normalized_0_1000 (Gemini standard)', () => {\n\t\tconst parsed = { image: {} };\n\t\texpect(ensureCoordSystem(parsed, 'normalized_0_1000')).toBe('normalized_0_1000');\n\t});\n\n\ttest('ensureCoordOrigin defaults to top-left (Gemini standard)', () => {\n\t\texpect(ensureCoordOrigin({}, 'top-left')).toBe('top-left');\n\t});  test('clamp limits values to provided range and handles non-finite inputs', () => {\n\t\texpect(clamp(15, 0, 10)).toBe(10);\n\t\texpect(clamp(-5, 0, 10)).toBe(0);\n\t\texpect(clamp(Number.NaN, 0, 10)).toBe(0);\n\t});\n\n\tdescribe('Integration: Full Gemini response flow', () => {\n\t\ttest('Complete flow from Gemini response to canvas coordinates', () => {\n\t\t\t// Simulate a Gemini API response with the official format\n\t\t\tconst geminiResponse = {\n\t\t\t\timage: {\n\t\t\t\t\twidth: 1920,\n\t\t\t\t\theight: 1080,\n\t\t\t\t\tcoordSystem: 'normalized_0_1000'\n\t\t\t\t},\n\t\t\t\tdetections: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: '1',\n\t\t\t\t\t\tlabel: 'ladder',\n\t\t\t\t\t\tcategory: 'object',\n\t\t\t\t\t\tconfidence: 0.95,\n\t\t\t\t\t\t// Gemini's [ymin, xmin, ymax, xmax] format, normalized 0-1000\n\t\t\t\t\t\t// This represents: ymin=20%, xmin=10%, ymax=80%, xmax=50%\n\t\t\t\t\t\tbbox: [200, 100, 800, 500]\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst imgW = geminiResponse.image.width;\n\t\t\tconst imgH = geminiResponse.image.height;\n\t\t\tconst canvasW = 960; // Half size display\n\t\t\tconst canvasH = 540;\n\t\t\tconst scaleX = canvasW / imgW; // 0.5\n\t\t\tconst scaleY = canvasH / imgH; // 0.5\n\n\t\t\tconst coordSystem = ensureCoordSystem(geminiResponse, 'normalized_0_1000');\n\t\t\tconst coordOrigin = ensureCoordOrigin(geminiResponse, 'top-left');\n\n\t\t\texpect(coordSystem).toBe('normalized_0_1000');\n\t\t\texpect(coordOrigin).toBe('top-left');\n\n\t\t\tconst detection = geminiResponse.detections[0];\n\t\t\tconst canvasBox = toCanvasBox(\n\t\t\t\tdetection.bbox,\n\t\t\t\tcoordSystem,\n\t\t\t\tscaleX,\n\t\t\t\tscaleY,\n\t\t\t\timgW,\n\t\t\t\timgH,\n\t\t\t\tcoordOrigin,\n\t\t\t\tcanvasW,\n\t\t\t\tcanvasH\n\t\t\t);\n\n\t\t\t// Expected calculation:\n\t\t\t// [200, 100, 800, 500] normalized 0-1000\n\t\t\t// ymin = 200/1000 * 1080 = 216px\n\t\t\t// xmin = 100/1000 * 1920 = 192px\n\t\t\t// ymax = 800/1000 * 1080 = 864px\n\t\t\t// xmax = 500/1000 * 1920 = 960px\n\t\t\t// width = 960 - 192 = 768px\n\t\t\t// height = 864 - 216 = 648px\n\t\t\t// Scaled to canvas (0.5):\n\t\t\t// x = 192 * 0.5 = 96\n\t\t\t// y = 216 * 0.5 = 108\n\t\t\t// width = 768 * 0.5 = 384\n\t\t\t// height = 648 * 0.5 = 324\n\n\t\t\texpect(canvasBox).toEqual({\n\t\t\t\tx: 96,\n\t\t\t\ty: 108,\n\t\t\t\twidth: 384,\n\t\t\t\theight: 324\n\t\t\t});\n\t\t});\n\t});\n});\n"},"src/session.test.js":{"tests":[{"id":"63","name":"session createSession should create a session with unique ID and queued images","location":{"start":{"column":4,"line":15}}},{"id":"64","name":"session createSession should generate unique image IDs","location":{"start":{"column":4,"line":32}}},{"id":"65","name":"session calculateSessionAggregates should aggregate detections across multiple images","location":{"start":{"column":4,"line":44}}},{"id":"66","name":"session calculateSessionAggregates should skip images with error status","location":{"start":{"column":4,"line":89}}},{"id":"67","name":"session calculateSessionAggregates should handle empty detections","location":{"start":{"column":4,"line":112}}},{"id":"68","name":"session updateSessionStatus should return \"analyzing\" when images are still processing","location":{"start":{"column":4,"line":132}}},{"id":"69","name":"session updateSessionStatus should return \"completed\" when all images are completed","location":{"start":{"column":4,"line":144}}},{"id":"70","name":"session updateSessionStatus should return \"error\" when all images failed","location":{"start":{"column":4,"line":155}}},{"id":"71","name":"session updateSessionStatus should return \"partial_failure\" when some succeed and some fail","location":{"start":{"column":4,"line":166}}},{"id":"72","name":"session getSessionProgress should calculate progress metrics correctly","location":{"start":{"column":4,"line":180}}}],"source":"/**\n * Tests for session management\n */\n\nimport {\n\tcreateSession,\n\tcalculateSessionAggregates,\n\tupdateSessionStatus,\n\tgetSessionProgress\n} from './session.js';\n\ndescribe('session', () => {\n\tdescribe('createSession', () => {\n\t\tit('should create a session with unique ID and queued images', () => {\n\t\t\tconst files = [\n\t\t\t\tnew File(['content1'], 'image1.jpg', { type: 'image/jpeg' }),\n\t\t\t\tnew File(['content2'], 'image2.jpg', { type: 'image/jpeg' })\n\t\t\t];\n\n\t\t\tconst session = createSession(files);\n\n\t\t\texpect(session.sessionId).toMatch(/^session_\\d+_[a-z0-9]+$/);\n\t\t\texpect(session.status).toBe('analyzing');\n\t\t\texpect(session.images).toHaveLength(2);\n\t\t\texpect(session.images[0].status).toBe('queued');\n\t\t\texpect(session.images[1].status).toBe('queued');\n\t\t\texpect(session.images[0].filename).toBe('image1.jpg');\n\t\t\texpect(session.activeImageIndex).toBe(0);\n\t\t});\n\n\t\tit('should generate unique image IDs', () => {\n\t\t\tconst files = [\n\t\t\t\tnew File(['c1'], 'test.jpg', { type: 'image/jpeg' }),\n\t\t\t\tnew File(['c2'], 'test.jpg', { type: 'image/jpeg' })\n\t\t\t];\n\n\t\t\tconst session = createSession(files);\n\t\t\texpect(session.images[0].id).not.toBe(session.images[1].id);\n\t\t});\n\t});\n\n\tdescribe('calculateSessionAggregates', () => {\n\t\tit('should aggregate detections across multiple images', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'a.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: [\n\t\t\t\t\t\t\t{ label: 'Worker', category: 'object', confidence: 0.9 },\n\t\t\t\t\t\t\t{ label: 'Helmet', category: 'object', confidence: 0.8 }\n\t\t\t\t\t\t]\n\t\t\t\t\t},\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img2',\n\t\t\t\t\t\tfilename: 'b.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: [\n\t\t\t\t\t\t\t{ label: 'Worker', category: 'object', confidence: 0.85 },\n\t\t\t\t\t\t\t{ \n\t\t\t\t\t\t\t\tlabel: 'Missing PPE', \n\t\t\t\t\t\t\t\tcategory: 'safety_issue', \n\t\t\t\t\t\t\t\tconfidence: 0.9,\n\t\t\t\t\t\t\t\tsafety: { severity: 'high', rule: 'PPE Required' }\n\t\t\t\t\t\t\t}\n\t\t\t\t\t\t]\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst agg = calculateSessionAggregates(session);\n\n\t\t\texpect(agg.totalDetections).toBe(4);\n\t\t\texpect(agg.categoryCounts).toEqual([\n\t\t\t\t{ category: 'object', count: 3 },\n\t\t\t\t{ category: 'safety_issue', count: 1 }\n\t\t\t]);\n\t\t\texpect(agg.labelCounts).toEqual([\n\t\t\t\t{ label: 'Worker', count: 2 },\n\t\t\t\t{ label: 'Helmet', count: 1 },\n\t\t\t\t{ label: 'Missing PPE', count: 1 }\n\t\t\t]);\n\t\t\texpect(agg.safetyIssues.high).toBe(1);\n\t\t\texpect(agg.imageStats).toHaveLength(2);\n\t\t});\n\n\t\tit('should skip images with error status', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'a.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: [{ label: 'Worker', category: 'object' }]\n\t\t\t\t\t},\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img2',\n\t\t\t\t\t\tfilename: 'b.jpg',\n\t\t\t\t\t\tstatus: 'error',\n\t\t\t\t\t\tdetections: []\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst agg = calculateSessionAggregates(session);\n\t\t\texpect(agg.totalDetections).toBe(1);\n\t\t\texpect(agg.imageStats).toHaveLength(1);\n\t\t});\n\n\t\tit('should handle empty detections', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'a.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: []\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst agg = calculateSessionAggregates(session);\n\t\t\texpect(agg.totalDetections).toBe(0);\n\t\t\texpect(agg.categoryCounts).toEqual([]);\n\t\t\texpect(agg.labelCounts).toEqual([]);\n\t\t});\n\t});\n\n\tdescribe('updateSessionStatus', () => {\n\t\tit('should return \"analyzing\" when images are still processing', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{ status: 'completed' },\n\t\t\t\t\t{ status: 'analyzing' },\n\t\t\t\t\t{ status: 'queued' }\n\t\t\t\t]\n\t\t\t};\n\n\t\t\texpect(updateSessionStatus(session)).toBe('analyzing');\n\t\t});\n\n\t\tit('should return \"completed\" when all images are completed', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{ status: 'completed' },\n\t\t\t\t\t{ status: 'completed' }\n\t\t\t\t]\n\t\t\t};\n\n\t\t\texpect(updateSessionStatus(session)).toBe('completed');\n\t\t});\n\n\t\tit('should return \"error\" when all images failed', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{ status: 'error' },\n\t\t\t\t\t{ status: 'error' }\n\t\t\t\t]\n\t\t\t};\n\n\t\t\texpect(updateSessionStatus(session)).toBe('error');\n\t\t});\n\n\t\tit('should return \"partial_failure\" when some succeed and some fail', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{ status: 'completed' },\n\t\t\t\t\t{ status: 'error' },\n\t\t\t\t\t{ status: 'completed' }\n\t\t\t\t]\n\t\t\t};\n\n\t\t\texpect(updateSessionStatus(session)).toBe('partial_failure');\n\t\t});\n\t});\n\n\tdescribe('getSessionProgress', () => {\n\t\tit('should calculate progress metrics correctly', () => {\n\t\t\tconst session = {\n\t\t\t\timages: [\n\t\t\t\t\t{ status: 'completed' },\n\t\t\t\t\t{ status: 'completed' },\n\t\t\t\t\t{ status: 'analyzing' },\n\t\t\t\t\t{ status: 'queued' },\n\t\t\t\t\t{ status: 'error' }\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst progress = getSessionProgress(session);\n\n\t\t\texpect(progress.total).toBe(5);\n\t\t\texpect(progress.completed).toBe(2);\n\t\t\texpect(progress.error).toBe(1);\n\t\t\texpect(progress.analyzing).toBe(1);\n\t\t\texpect(progress.queued).toBe(1);\n\t\t\texpect(progress.done).toBe(3);\n\t\t\texpect(progress.percentage).toBe(60);\n\t\t});\n\t});\n});\n"},"src/export.test.js":{"tests":[{"id":"73","name":"export exportSessionJSON should export session as valid JSON","location":{"start":{"column":4,"line":10}}},{"id":"74","name":"export exportSessionJSON should skip images with error status","location":{"start":{"column":4,"line":52}}},{"id":"75","name":"export exportSessionCSV should export session as CSV with header","location":{"start":{"column":4,"line":87}}},{"id":"76","name":"export exportSessionCSV should escape CSV fields with commas","location":{"start":{"column":4,"line":119}}},{"id":"77","name":"export exportSessionCSV should include safety and progress fields","location":{"start":{"column":4,"line":144}}},{"id":"78","name":"export exportSessionCSV should handle empty detections","location":{"start":{"column":4,"line":185}}}],"source":"/**\n * Tests for export utilities\n */\n\nimport { exportSessionJSON, exportSessionCSV } from './export.js';\n\ndescribe('export', () => {\n\tdescribe('exportSessionJSON', () => {\n\t\tit('should export session as valid JSON', () => {\n\t\t\tconst session = {\n\t\t\t\tsessionId: 'test_session',\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'test.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tnaturalWidth: 1920,\n\t\t\t\t\t\tnaturalHeight: 1080,\n\t\t\t\t\t\tdetections: [\n\t\t\t\t\t\t\t{ \n\t\t\t\t\t\t\t\tid: 'det1', \n\t\t\t\t\t\t\t\tlabel: 'Worker', \n\t\t\t\t\t\t\t\tcategory: 'object', \n\t\t\t\t\t\t\t\tconfidence: 0.95 \n\t\t\t\t\t\t\t}\n\t\t\t\t\t\t],\n\t\t\t\t\t\tparsedData: {\n\t\t\t\t\t\t\tglobal_insights: [\n\t\t\t\t\t\t\t\t{ name: 'Site Overview', description: 'Test site' }\n\t\t\t\t\t\t\t]\n\t\t\t\t\t\t}\n\t\t\t\t\t}\n\t\t\t\t],\n\t\t\t\tsessionAggregates: {\n\t\t\t\t\ttotalDetections: 1,\n\t\t\t\t\tsafetyIssues: { high: 0, medium: 0, low: 0 }\n\t\t\t\t}\n\t\t\t};\n\n\t\t\tconst json = exportSessionJSON(session);\n\t\t\tconst parsed = JSON.parse(json);\n\n\t\t\texpect(parsed.sessionId).toBe('test_session');\n\t\t\texpect(parsed.totalImages).toBe(1);\n\t\t\texpect(parsed.imagesAnalyzed).toBe(1);\n\t\t\texpect(parsed.images).toHaveLength(1);\n\t\t\texpect(parsed.images[0].filename).toBe('test.jpg');\n\t\t\texpect(parsed.images[0].detections).toHaveLength(1);\n\t\t});\n\n\t\tit('should skip images with error status', () => {\n\t\t\tconst session = {\n\t\t\t\tsessionId: 'test',\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'a.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tnaturalWidth: 100,\n\t\t\t\t\t\tnaturalHeight: 100,\n\t\t\t\t\t\tdetections: [{ label: 'Worker' }],\n\t\t\t\t\t\tparsedData: {}\n\t\t\t\t\t},\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img2',\n\t\t\t\t\t\tfilename: 'b.jpg',\n\t\t\t\t\t\tstatus: 'error',\n\t\t\t\t\t\tnaturalWidth: 0,\n\t\t\t\t\t\tnaturalHeight: 0,\n\t\t\t\t\t\tdetections: [],\n\t\t\t\t\t\tparsedData: null\n\t\t\t\t\t}\n\t\t\t\t],\n\t\t\t\tsessionAggregates: { totalDetections: 1 }\n\t\t\t};\n\n\t\t\tconst json = exportSessionJSON(session);\n\t\t\tconst parsed = JSON.parse(json);\n\n\t\t\texpect(parsed.images).toHaveLength(1);\n\t\t\texpect(parsed.images[0].filename).toBe('a.jpg');\n\t\t});\n\t});\n\n\tdescribe('exportSessionCSV', () => {\n\t\tit('should export session as CSV with header', () => {\n\t\t\tconst session = {\n\t\t\t\tsessionId: 'test_session',\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'test.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: [\n\t\t\t\t\t\t\t{\n\t\t\t\t\t\t\t\tid: 'det1',\n\t\t\t\t\t\t\t\tlabel: 'Worker',\n\t\t\t\t\t\t\t\tcategory: 'object',\n\t\t\t\t\t\t\t\tconfidence: 0.95\n\t\t\t\t\t\t\t}\n\t\t\t\t\t\t]\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst csv = exportSessionCSV(session);\n\t\t\tconst lines = csv.split('\\n');\n\n\t\t\texpect(lines[0]).toContain('SessionID');\n\t\t\texpect(lines[0]).toContain('ImageID');\n\t\t\texpect(lines[0]).toContain('DetectionID');\n\t\t\texpect(lines[1]).toContain('test_session');\n\t\t\texpect(lines[1]).toContain('img1');\n\t\t\texpect(lines[1]).toContain('Worker');\n\t\t\texpect(lines[1]).toContain('0.9500');\n\t\t});\n\n\t\tit('should escape CSV fields with commas', () => {\n\t\t\tconst session = {\n\t\t\t\tsessionId: 'test',\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'file,with,commas.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: [\n\t\t\t\t\t\t\t{\n\t\t\t\t\t\t\t\tid: 'det1',\n\t\t\t\t\t\t\t\tlabel: 'Worker, standing',\n\t\t\t\t\t\t\t\tcategory: 'object',\n\t\t\t\t\t\t\t\tconfidence: 0.8\n\t\t\t\t\t\t\t}\n\t\t\t\t\t\t]\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst csv = exportSessionCSV(session);\n\t\t\texpect(csv).toContain('\"file,with,commas.jpg\"');\n\t\t\texpect(csv).toContain('\"Worker, standing\"');\n\t\t});\n\n\t\tit('should include safety and progress fields', () => {\n\t\t\tconst session = {\n\t\t\t\tsessionId: 'test',\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'test.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: [\n\t\t\t\t\t\t\t{\n\t\t\t\t\t\t\t\tid: 'det1',\n\t\t\t\t\t\t\t\tlabel: 'Missing PPE',\n\t\t\t\t\t\t\t\tcategory: 'safety_issue',\n\t\t\t\t\t\t\t\tconfidence: 0.9,\n\t\t\t\t\t\t\t\tsafety: {\n\t\t\t\t\t\t\t\t\tseverity: 'high',\n\t\t\t\t\t\t\t\t\trule: 'PPE Required'\n\t\t\t\t\t\t\t\t}\n\t\t\t\t\t\t\t},\n\t\t\t\t\t\t\t{\n\t\t\t\t\t\t\t\tid: 'det2',\n\t\t\t\t\t\t\t\tlabel: 'Foundation',\n\t\t\t\t\t\t\t\tcategory: 'progress',\n\t\t\t\t\t\t\t\tconfidence: 0.85,\n\t\t\t\t\t\t\t\tprogress: {\n\t\t\t\t\t\t\t\t\tphase: 'In Progress',\n\t\t\t\t\t\t\t\t\tpercentComplete: 45.5\n\t\t\t\t\t\t\t\t}\n\t\t\t\t\t\t\t}\n\t\t\t\t\t\t]\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst csv = exportSessionCSV(session);\n\t\t\texpect(csv).toContain('high');\n\t\t\texpect(csv).toContain('PPE Required');\n\t\t\texpect(csv).toContain('In Progress');\n\t\t\texpect(csv).toContain('45.50');\n\t\t});\n\n\t\tit('should handle empty detections', () => {\n\t\t\tconst session = {\n\t\t\t\tsessionId: 'test',\n\t\t\t\timages: [\n\t\t\t\t\t{\n\t\t\t\t\t\tid: 'img1',\n\t\t\t\t\t\tfilename: 'test.jpg',\n\t\t\t\t\t\tstatus: 'completed',\n\t\t\t\t\t\tdetections: []\n\t\t\t\t\t}\n\t\t\t\t]\n\t\t\t};\n\n\t\t\tconst csv = exportSessionCSV(session);\n\t\t\tconst lines = csv.split('\\n');\n\n\t\t\t// Only header row\n\t\t\texpect(lines.length).toBe(1);\n\t\t});\n\t});\n});\n"},"src/report-ui.test.js":{"tests":[{"id":"79","name":"calculateAggregates calculates counts by label correctly","location":{"start":{"column":3,"line":4}}},{"id":"80","name":"calculateAggregates calculates counts by category correctly","location":{"start":{"column":3,"line":21}}},{"id":"81","name":"calculateAggregates handles empty detections array","location":{"start":{"column":3,"line":38}}},{"id":"82","name":"calculateAggregates handles detections with missing labels","location":{"start":{"column":3,"line":45}}},{"id":"83","name":"calculateAggregates handles detections with missing categories","location":{"start":{"column":3,"line":58}}},{"id":"84","name":"calculateAggregates sorts by count descending","location":{"start":{"column":3,"line":71}}},{"id":"85","name":"calculateAggregates handles single detection","location":{"start":{"column":3,"line":90}}},{"id":"86","name":"calculateAggregates handles duplicate entries correctly","location":{"start":{"column":3,"line":105}}}],"source":"import { calculateAggregates } from './report-ui.js';\n\ndescribe('calculateAggregates', () => {\n\ttest('calculates counts by label correctly', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', label: 'ladder', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '2', label: 'ladder', category: 'object', confidence: 0.85 },\n\t\t\t{ id: '3', label: 'exit sign', category: 'facility_asset', confidence: 0.95 },\n\t\t\t{ id: '4', label: 'hard hat', category: 'object', confidence: 0.8 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByLabel).toEqual([\n\t\t\t{ label: 'ladder', count: 2 },\n\t\t\t{ label: 'exit sign', count: 1 },\n\t\t\t{ label: 'hard hat', count: 1 }\n\t\t]);\n\t});\n\n\ttest('calculates counts by category correctly', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', label: 'ladder', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '2', label: 'scaffold', category: 'object', confidence: 0.85 },\n\t\t\t{ id: '3', label: 'exit sign', category: 'facility_asset', confidence: 0.95 },\n\t\t\t{ id: '4', label: 'no hard hat', category: 'safety_issue', confidence: 0.8 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByCategory).toEqual([\n\t\t\t{ category: 'object', count: 2 },\n\t\t\t{ category: 'facility_asset', count: 1 },\n\t\t\t{ category: 'safety_issue', count: 1 }\n\t\t]);\n\t});\n\n\ttest('handles empty detections array', () => {\n\t\tconst result = calculateAggregates([]);\n\n\t\texpect(result.countsByLabel).toEqual([]);\n\t\texpect(result.countsByCategory).toEqual([]);\n\t});\n\n\ttest('handles detections with missing labels', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '2', label: 'ladder', category: 'object', confidence: 0.85 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByLabel).toHaveLength(2);\n\t\texpect(result.countsByLabel).toContainEqual({ label: 'ladder', count: 1 });\n\t\texpect(result.countsByLabel).toContainEqual({ label: 'unknown', count: 1 });\n\t});\n\n\ttest('handles detections with missing categories', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', label: 'ladder', confidence: 0.9 },\n\t\t\t{ id: '2', label: 'scaffold', category: 'object', confidence: 0.85 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByCategory).toHaveLength(2);\n\t\texpect(result.countsByCategory).toContainEqual({ category: 'object', count: 1 });\n\t\texpect(result.countsByCategory).toContainEqual({ category: 'other', count: 1 });\n\t});\n\n\ttest('sorts by count descending', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', label: 'A', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '2', label: 'B', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '3', label: 'B', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '4', label: 'C', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '5', label: 'C', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '6', label: 'C', category: 'object', confidence: 0.9 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByLabel).toEqual([\n\t\t\t{ label: 'C', count: 3 },\n\t\t\t{ label: 'B', count: 2 },\n\t\t\t{ label: 'A', count: 1 }\n\t\t]);\n\t});\n\n\ttest('handles single detection', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', label: 'ladder', category: 'object', confidence: 0.9 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByLabel).toEqual([\n\t\t\t{ label: 'ladder', count: 1 }\n\t\t]);\n\t\texpect(result.countsByCategory).toEqual([\n\t\t\t{ category: 'object', count: 1 }\n\t\t]);\n\t});\n\n\ttest('handles duplicate entries correctly', () => {\n\t\tconst detections = [\n\t\t\t{ id: '1', label: 'ladder', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '2', label: 'ladder', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '3', label: 'ladder', category: 'object', confidence: 0.9 },\n\t\t\t{ id: '4', label: 'ladder', category: 'object', confidence: 0.9 }\n\t\t];\n\n\t\tconst result = calculateAggregates(detections);\n\n\t\texpect(result.countsByLabel).toEqual([\n\t\t\t{ label: 'ladder', count: 4 }\n\t\t]);\n\t\texpect(result.countsByCategory).toEqual([\n\t\t\t{ category: 'object', count: 4 }\n\t\t]);\n\t});\n});\n"},"src/batch-processor.test.js":{"tests":[{"id":"87","name":"batch-processor processBatch should process all items successfully","location":{"start":{"column":4,"line":10}}},{"id":"88","name":"batch-processor processBatch should handle errors gracefully","location":{"start":{"column":4,"line":31}}},{"id":"89","name":"batch-processor processBatch should call progress callback for each item","location":{"start":{"column":4,"line":55}}},{"id":"90","name":"batch-processor processBatch should respect concurrency limit","location":{"start":{"column":4,"line":76}}},{"id":"91","name":"batch-processor processBatch should preserve order of results","location":{"start":{"column":4,"line":96}}},{"id":"92","name":"batch-processor delay should resolve after specified time","location":{"start":{"column":4,"line":117}}}],"source":"/**\n * Tests for batch processor\n */\n\nimport { processBatch, delay } from './batch-processor.js';\n\ndescribe('batch-processor', () => {\n\tdescribe('processBatch', () => {\n\t\tit('should process all items successfully', async () => {\n\t\t\tconst items = [\n\t\t\t\t{ id: 1, value: 'a' },\n\t\t\t\t{ id: 2, value: 'b' },\n\t\t\t\t{ id: 3, value: 'c' }\n\t\t\t];\n\n\t\t\tconst processOne = async (item) => {\n\t\t\t\tawait delay(10);\n\t\t\t\treturn { result: item.value.toUpperCase() };\n\t\t\t};\n\n\t\t\tconst results = await processBatch(items, processOne);\n\n\t\t\texpect(results).toHaveLength(3);\n\t\t\texpect(results[0].success).toBe(true);\n\t\t\texpect(results[0].data.result).toBe('A');\n\t\t\texpect(results[1].data.result).toBe('B');\n\t\t\texpect(results[2].data.result).toBe('C');\n\t\t});\n\n\t\tit('should handle errors gracefully', async () => {\n\t\t\tconst items = [\n\t\t\t\t{ id: 1, shouldFail: false },\n\t\t\t\t{ id: 2, shouldFail: true },\n\t\t\t\t{ id: 3, shouldFail: false }\n\t\t\t];\n\n\t\t\tconst processOne = async (item) => {\n\t\t\t\tawait delay(5);\n\t\t\t\tif (item.shouldFail) {\n\t\t\t\t\tthrow new Error('Processing failed');\n\t\t\t\t}\n\t\t\t\treturn { id: item.id, status: 'ok' };\n\t\t\t};\n\n\t\t\tconst results = await processBatch(items, processOne);\n\n\t\t\texpect(results).toHaveLength(3);\n\t\t\texpect(results[0].success).toBe(true);\n\t\t\texpect(results[1].success).toBe(false);\n\t\t\texpect(results[1].error.message).toBe('Processing failed');\n\t\t\texpect(results[2].success).toBe(true);\n\t\t});\n\n\t\tit('should call progress callback for each item', async () => {\n\t\t\tconst items = [{ id: 1 }, { id: 2 }];\n\t\t\tconst progressCalls = [];\n\n\t\t\tconst processOne = async (item) => {\n\t\t\t\tawait delay(5);\n\t\t\t\treturn { processed: item.id };\n\t\t\t};\n\n\t\t\tconst onProgress = (image, result, error) => {\n\t\t\t\tprogressCalls.push({ image, result, error });\n\t\t\t};\n\n\t\t\tawait processBatch(items, processOne, onProgress);\n\n\t\t\texpect(progressCalls).toHaveLength(2);\n\t\t\texpect(progressCalls[0].result.processed).toBe(1);\n\t\t\texpect(progressCalls[0].error).toBeNull();\n\t\t\texpect(progressCalls[1].result.processed).toBe(2);\n\t\t});\n\n\t\tit('should respect concurrency limit', async () => {\n\t\t\tconst items = Array.from({ length: 25 }, (_, i) => ({ id: i }));\n\t\t\tlet maxConcurrent = 0;\n\t\t\tlet currentConcurrent = 0;\n\n\t\t\tconst processOne = async (item) => {\n\t\t\t\tcurrentConcurrent++;\n\t\t\t\tmaxConcurrent = Math.max(maxConcurrent, currentConcurrent);\n\t\t\t\tawait delay(20);\n\t\t\t\tcurrentConcurrent--;\n\t\t\t\treturn { id: item.id };\n\t\t\t};\n\n\t\t\tawait processBatch(items, processOne);\n\n\t\t\t// Should not exceed MAX_CONCURRENT (10)\n\t\t\texpect(maxConcurrent).toBeLessThanOrEqual(10);\n\t\t\texpect(maxConcurrent).toBeGreaterThan(1); // Should use concurrency\n\t\t});\n\n\t\tit('should preserve order of results', async () => {\n\t\t\tconst items = [\n\t\t\t\t{ id: 1, delay: 50 },\n\t\t\t\t{ id: 2, delay: 10 },\n\t\t\t\t{ id: 3, delay: 30 }\n\t\t\t];\n\n\t\t\tconst processOne = async (item) => {\n\t\t\t\tawait delay(item.delay);\n\t\t\t\treturn { id: item.id };\n\t\t\t};\n\n\t\t\tconst results = await processBatch(items, processOne);\n\n\t\t\texpect(results[0].data.id).toBe(1);\n\t\t\texpect(results[1].data.id).toBe(2);\n\t\t\texpect(results[2].data.id).toBe(3);\n\t\t});\n\t});\n\n\tdescribe('delay', () => {\n\t\tit('should resolve after specified time', async () => {\n\t\t\tconst start = Date.now();\n\t\t\tawait delay(50);\n\t\t\tconst elapsed = Date.now() - start;\n\n\t\t\texpect(elapsed).toBeGreaterThanOrEqual(45);\n\t\t\texpect(elapsed).toBeLessThan(100);\n\t\t});\n\t});\n});\n"}},"projectRoot":"/home/runner/work/gemini-vlm-demo/gemini-vlm-demo","config":{"testRunner":"jest","reporters":["clear-text","json","progress","html"],"mutate":["src/**/*.js","!src/**/*.test.js"],"coverageAnalysis":"perTest","thresholds":{"high":90,"low":60,"break":50},"jsonReporter":{"fileName":"mutation-testing/reports/mutation-report.json"},"htmlReporter":{"fileName":"mutation-testing/reports/html/index.html"},"configFile":"config/stryker.conf.json","allowConsoleColors":true,"checkers":[],"checkerNodeArgs":[],"commandRunner":{"command":"npm test"},"clearTextReporter":{"allowColor":true,"allowEmojis":false,"logTests":true,"maxTestsToLog":3,"reportTests":true,"reportMutants":true,"reportScoreTable":true,"skipFull":false},"dashboard":{"baseUrl":"https://dashboard.stryker-mutator.io/api/reports","reportType":"full"},"dryRunOnly":false,"eventReporter":{"baseDir":"reports/mutation/events"},"ignorePatterns":[],"ignoreStatic":false,"incremental":false,"incrementalFile":"reports/stryker-incr
